import React from 'react'
import './style-footer.css'

export default function Footer() {
  return (
    <section className='content-footer'>
      <div className="top-footer"><a href="#">Ми на карті</a></div>
      <div className="line-footer"></div>
      <div className="left-footer"><Line to="/home">НА Головну</Line></div>
      <div className="center-footer"><p>Всі права за</p></div>
      <div className="right-footer"></div>
    </section>
  )
}
